(48, 'Barangay Clearance', '<p>View the requirements needed for Barangay Clearance and acquire online now.</p>', '.png', '16647286424583884336339be429ad78', '2024-07-07 01:39:00', '2022-10-11', 3, 1),
(86, 'Nutrition Months', '<p>Good morning to all residents of Barangay Kaongkod!</p><p>As we celebrate Nutrition Month this July, we invite everyone to participate in the activities organized by our barangay promoting health and proper nutrition for all.</p><p><span style=\"background-color: transparent;\">With the theme \"Proper Nutrition: Key to Good Health!\" we aim to emphasize the importance of consuming nutritious food for our well-being and development.</span></p><p>We will have various activities such as vegetable planting, cooking demonstrations featuring nutritious meals, and seminars on proper nutrition.</p><p>Join us in spreading awareness about taking care of our bodies through healthy eating habits.</p><p><span style=\"background-color: transparent;\">Thank you very much, and see you all in our upcoming activities!</span></p>', '16691004011710705723637c7371e53be.png', '1721659343744161066669e6fcf35fd0', '2024-07-01 08:30:00', '2024-07-22', 0, 1),
(87, 'Barangay Assembly', '<p>Good day to all residents of Barangay Kaongkod!</p><p>Please be informed that our Barangay Assembly will be held on August 1, 2024 at 09:00 AM in Madridejos Cultural Covered Court. We encourage all barangay residents to attend this important gathering as it concerns our community&#39;s welfare and development.</p><p><span style=\"background-color: transparent;\">During the assembly, we will discuss various matters including updates on barangay projects, financial reports, and upcoming initiatives. This is also an opportunity for you to voice out your concerns, suggestions, and feedback for the betterment of our barangay.</span></p><p>Your participation is crucial in ensuring that our community continues to thrive and improve. Let us work together towards a brighter future for Barangay Kaongkod.</p><p>Thank you and see you all at the Barangay Assembly!</p>', '16691004011710705723637c7371e53be.png', '17216596872133664239669e712740594', '2024-08-01 09:00:00', '2024-08-01', 0, 1);
