INSERT INTO `content_management` (`id`, `story`, `mission`, `vission`, `guidelines`, `brgy_head`, `brgy_head_pic`, `clearance`, `residency`, `indigency`, `fb_link`, `iframe`) VALUES
(1, '<p style=\"text-align: left;\"><span style=\"font-size: 18px;\">As per story related by the early inhabitants of this Barangay the name &quot;Kaongkod&quot; is a combination of two vernacular words &quot;Kaong&quot; meaning to eat and &quot;Gokod&quot; to chase or to go after something or somebody.</span></p>', '<p>In order to achieve our vision, we pledge to promote unity, cooperation, realization and sincerity among the residents. We shall popuralized, approachable, supportive, responsive and above all God-fearing community.</p>', '<p><span style=\"font-size: 18px;\">Barangay kaongkod envisions a community with a transparent and accountable constituents for good governance. To achieve challenges, prosperity and development in all aspect, into produce a progressive, peace loving community and environmentally friendly through the guidance of our Almighty God.</span></p>', , 'Hon. Magdalena B. Marollano', '1718607417616685351666fde39c7b2d', , , , 'https://maps.google.com/maps?q=Brgy.%20Salvacion%201st,%20Lupao&t=&z=13&ie=UTF8&iwloc=&output=embed', 'https://maps.google.com/maps?q=lubao%20pampanga&t=&z=13&ie=UTF8&iwloc=&output=embed');
